In the backdrop of Shivgad, a small village     
in the border of Maharashtra and Goa, the       
film revolves around the story of an honest,    
diligent and honoured Inspector Bajirao         
Singham played by Mr. Ajay Devgn who fights     
against injustice and prejudice using his       
own ethics and principles.A sudden strike       
of destiny sets up Singham against the          
tremendously powerful criminal cum politician   
Jaykant Shikre (Prakash Raj), challenging his   
morals and beliefs. Jaykant's powerful          
planning and force makes Singham land up in the 
ruling city of Jaykant Shikre, the city of      
'Goa', where he leaves no stone unturned to     
make Singham's life a nightmare to live.        


